import React from 'react';

interface myObj
{
	color:any,
	name:any,
	isSpecial:any
}

function Hello({color, name, isSpecial}: myObj) {
  return (
	<div style={{color}}>
	  { isSpecial ? <b>*</b> : null}
	  안녕하세요 {name}
	</div>
  )
}

Hello.defaultProps = {
	name: '이름없음'
}
export default Hello;


export function Wrapper({children}: any) {
	const style = {
		border: '2px solid black',
		padding: '16px'
	};
	return (
		<div style={style}>
		{children}
		</div>
	)
}
